import React, { useEffect, useState } from 'react';
import api from '../api';

const Products = () => {
  const [products, setProducts] = useState([]);

  useEffect(() => {
    api.get('/products').then(res => setProducts(res.data));
  }, []);

  return (
    <div>
      <h2>Product List</h2>
      <ul>
        {products.map(p => <li key={p._id}>{p.name} - {p.stock}</li>)}
      </ul>
    </div>
  );
};

export default Products;
